    function Price(id) {
        var id = id.split('-')[1];
        var PaperType = $(""#PaperType-"" + id).val();
        var PaperP = $(""#PaperP-"" + id).val();
        var Count = $(""#Count-"" + id).val();
        var deadline = $(""#deadline-"" + id).val();
        $('#update-message').removeClass('showMessage');
        $.post(""/ShoppingCart/Calculate"", { ""id"": id, ""PaperType"": PaperType, ""PaperP"": PaperP, ""Count"": Count, ""deadline"": deadline },
            function (data) {
                if (data.price != 0) {
                    console.log(data.Price);
                    $(""#Price-"" + id).text(data.price + "" руб."");
                    $(""#UnitPrice-"" + id).text(data.price / Count + "" руб."");
                    $(""#Total"").text(""Итого:"" + data.total + "" руб."");
                    $('#update-message').addClass('showMessage');
                    $('#update-message').text(""Данные записаны"");
                }
            });
    }
</script>");
            EndContext();
